import React from "react";
import { View, StyleSheet, Text } from "react-native";

const BoxScreen = () => {
  return (
    <View style={styles.viewPoint}>
      <View style={styles.textOneStyle}></View>
      <View></View>
      <View></View>
    </View>
  );
};

const styles = StyleSheet.create({
  viewPoint: {
    margin: 15,
    borderWidth: 2,
    padding: 15,
    borderColor: "red",
    flexDirection: "row",
  },

  textOneStyle: {
    borderWidth: 4,
    borderColor: "black",
    padding: 10,
    flex: 1,
  },
  textTwoStyle: {
    borderWidth: 4,
    borderColor: "black",
    padding: 10,
    flex: 1,
    alignItems: "center",
    marginTop: 100,
  },
  textThreeStyle: {
    borderWidth: 4,
    borderColor: "black",
    padding: 10,
    flex: 1,
  },
});

export default BoxScreen;
